import React from 'react'
import styles from './styles.module.css'
const Users = (props) => {

   if(props.setUsers.length===0){ 
props.setUsers([
    { id: 1,photoUrl: 'data:image/jpeg;base64,',
    followed: true, fullName: "Yerkozha", status: 'dsasda', location: { city: 'Aktay', country: 'Kazakstan' } },
    { id: 2,photoUrl: 'data:image/jpeg;base64,',
    followed: false, fullName: "Mara", status: 'dsasda', location: { city: 'Aktay', country: 'Kazakstan' } },
    { id: 3,photoUrl: 'data:image/jpeg;base64,',
    followed: true, fullName: "Bara", status: 'dsa', location: { city: 'Aktay', country: 'Kazakstan' } }])
   }



    return <div>
        {
            props.users.map(u => <div key={u.id}>
                <span>
                    <div>
                        <img src={u.photoUrl} className = {styles.userPhoto}/>
                    </div>
                    <div>
                        {
                            u.followed 
                            ? <button onClick={()=>{props.unfollow(u.id)  }}>Unfollow</button> 
                            : <button onClick={()=>{props.follow(u.id)  }}>Follow</button> 
                        }
                        
                    </div>
                </span>
                <span>
                    <span>
                        <div>{u.fullName}</div>
                        <div>{u.status}</div>
                    </span>
                    <span>
                        <div>{u.location.city}</div>
                        <div>{u.location.county}</div>
                    </span>
                </span>
            </div>
            )
        }
    </div>
}

export default Users